double scalar_product_seq ( double v[] , double u[] , int n) {
    double result1;
    for ( int i = 0; i < n ; i++) {
        result1 += v[i] * u[i];
    }
    return result1;
}
void *scalar_product (void*arg) {
    int start = *(int*)arg;
    int end = start + N/num;
    double partial_result = 0.0;

    for (int i = start; i < end; i++) {
        partial_result += first[i] * second[i];
    }
    pthread_mutex_lock(&lock);
    result += partial_result;
    pthread_mutex_unlock(&lock);
}
